static const size_t crypt_len_test_data = CHUNK_LENGTH + SL_SI91X_TAG_SIZE;

unsigned char cipher_tag_buffer[CHUNK_COUNT][GCM_TEST_CT_MAX_LEN];
unsigned char decryption_output[CHUNK_COUNT][GCM_TEST_CT_MAX_LEN];
unsigned char encryption_tag[CHUNK_COUNT][SL_SI91X_TAG_SIZE];
unsigned char decryption_tag[CHUNK_COUNT][SL_SI91X_TAG_SIZE];

void test_psa_gcm()
{
  psa_status_t status;
  size_t out_len;

  /* psa crypto library initialization */
  status = psa_crypto_init();
  if (status == PSA_SUCCESS) {
    printf("\n PSA crypto library initialization Success \n");
  } else {
    printf("\n PSA crypto library initialization failed with error: %ld\n", status);
    SL_ASSERT(FALSE);
  }

  psa_key_id_t key_id;
  psa_key_attributes_t key_attr = psa_key_attributes_init();

  //Set up attributes for a AES GCM key
  psa_set_key_type(&key_attr, PSA_KEY_TYPE_AES);
  psa_set_key_usage_flags(&key_attr, PSA_KEY_USAGE_ENCRYPT | PSA_KEY_USAGE_DECRYPT);
  psa_set_key_algorithm(&key_attr, PSA_ALG_AEAD_WITH_SHORTENED_TAG(PSA_ALG_GCM, SL_SI91X_TAG_SIZE));

  //Import a volatile key for AES GCM Key
  status = psa_import_key(&key_attr, key_test_data, sizeof(key_test_data), &key_id);

  if (status == PSA_SUCCESS) {
    printf("\n Key import Success \n");
  } else {
    printf("\n Key import Failed with error: %ld\n", status);
    SL_ASSERT(FALSE);
  }

  printf("\n\n Multipart Encryption Started.......\n\n");

  uint8_t chunk_no = 0;
  for (int i = 0; i < GCM_TEST_PT_MAX_LEN; i = i + CHUNK_LENGTH) {
    status = psa_aead_encrypt(key_id,
                              PSA_ALG_AEAD_WITH_SHORTENED_TAG(PSA_ALG_GCM, SL_SI91X_TAG_SIZE),
                              iv_test_data,
                              sizeof(iv_test_data),
                              ad_test_data,
                              sizeof(ad_test_data),
                              &(msg_test_data[i]),
                              CHUNK_LENGTH,
                              cipher_tag_buffer[chunk_no],
                              crypt_len_test_data,
                              &out_len);

    if (status == 0 && memcmp(cipher_tag_buffer[chunk_no], res_test_data[chunk_no], CHUNK_LENGTH) == 0) {
      printf("\n Chunk-wise Encryption Success \n");
    } else {
      printf("\n Chunk-wise Encryption Failed with error: %ld\n", status);
      SL_ASSERT(FALSE);
    }
    memcpy(encryption_tag[chunk_no], cipher_tag_buffer[chunk_no] + CHUNK_LENGTH, SL_SI91X_TAG_SIZE);
    chunk_no++;
  }

  printf("\n\n Multipart Decryption Started.......\n\n");
  memset(decryption_output, 0, GCM_TEST_PT_MAX_LEN);

  chunk_no = 0;
  for (int i = 0; i < GCM_TEST_PT_MAX_LEN; i = i + CHUNK_LENGTH) {
    status = psa_aead_decrypt(key_id,
                              PSA_ALG_AEAD_WITH_SHORTENED_TAG(PSA_ALG_GCM, SL_SI91X_TAG_SIZE),
                              iv_test_data,
                              sizeof(iv_test_data),
                              ad_test_data,
                              sizeof(ad_test_data),
                              cipher_tag_buffer[chunk_no],
                              crypt_len_test_data,
                              decryption_output[chunk_no],
                              CHUNK_LENGTH,
                              &out_len);

    if (status == 0 && memcmp(decryption_output[chunk_no], &msg_test_data[i], CHUNK_LENGTH) == 0) {
      printf("\n Chunk-wise Decryption Success \n");
    } else {
      printf("\n Chunk-wise Decryption Failed with error: %ld\n", status);
      SL_ASSERT(FALSE);
    }
    memcpy(decryption_tag[chunk_no], decryption_output[chunk_no] + CHUNK_LENGTH, SL_SI91X_TAG_SIZE);
    chunk_no++;
  }

  for (int i = 0; i < CHUNK_COUNT; i++) {
    if (memcmp(decryption_tag[i], encryption_tag[i], SL_SI91X_TAG_SIZE) != 0) {
      printf("\r\nGCM Authentication Failed !!\r\n");
      status = SL_STATUS_INVALID_SIGNATURE;
    }
  }

  // Destroy plain key for AES GCM
  status = psa_destroy_key(key_id);
  if (status != PSA_SUCCESS) {
    printf("Destroy key failed with error: %ld\n", status);
  }
}
